(1, 'On `day six`, what did God do?', 'Created living creeping things on land', 'Created living creatures of the sea', 'Gathered together the waters into seas', 'Created living creatures of the air', 'Genesis 1:20-23', 1, 2, 1, 0, 0, 4),
